import React, { useState } from 'react';
import {
	Box,
	StackDivider,
	VStack,
	Heading,
	Text
} from '@chakra-ui/react';

const Recipe = ({ title, author, ...rest}) => {
	return (
		<Box p={5} shadow='md' borderWidth='1px' {...rest}>
			<Heading fontSize='x1'>{title}</Heading>
			<Text mt={4}>{author}</Text>
		</Box>
	)
}

const MyRecipes = () => {

	let ls = localStorage.getItem('recipe');
	console.log(ls)

	return (
		<VStack 
			divider={<StackDivider borderColor='gray.200' />}
			spacing={4}
			align='stretch'
		>
			<Recipe title={localStorage.getItem('recipe')}></Recipe>
		</VStack>
	)
}

export default MyRecipes;
